import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { first } from 'rxjs/operators';
import { BeneficiariosService } from 'src/app/services/beneficiarios.service';
import { AngularCsv } from 'angular-csv-ext/dist/Angular-csv';
import pdfmake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfmake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-tables',
  templateUrl: './tables.component.html',
  styleUrls: ['./tables.component.scss']
})
export class TablesComponent implements OnInit {
  beneficiarios: any;
  allBeneficiarios: any;
  success: boolean = false;
  error: boolean = false;
  errorMessage: string = '';
  headers: any;
  countries: any;
  searchTerm: string;
  page = 0;
  pageSize = 10;
  collectionSize: number = 0;

  constructor(
    private _router: Router,
    private beneficiariosService: BeneficiariosService
  ) { }

  ngOnInit() {
  }

  getBeneficiariosList(page: number = 0, pageSize: number = 10): void {
    this.beneficiariosService.get(page, pageSize).pipe(first()).subscribe({
      next: (res) => {
        this.beneficiarios = res.rows;
        this.allBeneficiarios = this.beneficiarios;
        this.collectionSize = res.totalItems;
      },
    });
  }

  pageChange(): void {
    this.getBeneficiariosList(this.page - 1, this.pageSize);
  }

  search(value: string): void {
    if (value) {
      this.beneficiariosService.search(value.toLowerCase()).pipe(first()).subscribe({
        next: (res) => {
          this.beneficiarios = res.rows;
          this.allBeneficiarios = this.beneficiarios;
          this.collectionSize = res.totalItems;
        },
      });
    } else {
      this.getBeneficiariosList(this.page - 1, this.pageSize);
    }
  }

  getAge(userAge): number {
    const currentYear = new Date().getFullYear();
    return currentYear - new Date(userAge).getFullYear();
  }

  delete(id: number): void {
    this.beneficiariosService.delete(id)
      .pipe(first())
      .subscribe({
        next: () => {
          this.success = true;
          setTimeout(() => {
            this.success = false;
          }, 3000);
          this.getBeneficiariosList();
        },
        error: (err) => {
          this.error = true;
          this.errorMessage = err.error.message;

          setTimeout(() => {
            this.error = false;
            this.errorMessage = '';
          }, 7000)
        }
      });
  }

  edit(id: number): void {
    this._router.navigate(['/edit-user-profile', id]);
  }

  exportData(): void {
    const options = {
      fieldSeparator: ',',
      quoteStrings: '"',
      decimalseparator: '.',
      showLabels: true,
      showTitle: true,
      title: 'Lista Beneficiarios',
      useBom: true,
      noDownload: false,
      headers: ['id', 'Identidad', 'Nombre', 'Apellido', 'Fecha de Nacimiento', 'Sexo', 'Telefono', 'Departamento', 'Municipio', 'Aldea', 'Barrio', 'Fecha Creacion', 'Fecha Edicion'],
      useHeader: false,
      nullToEmptyString: true,
    };

    const ordered = this.beneficiarios.map((elem) => {
      return {
        id: elem.id,
        identidad: elem.identidad,
        name: elem.name,
        lastName: elem.lastName,
        bornDate: elem.bornDate,
        sex: elem.sex,
        phone: elem.phone,
        department: elem.department,
        municipality: elem.municipality,
        village: elem.village,
        barrio: elem.barrio,
        createdAt: elem.createdAt,
        updatedAt: elem.updatedAt
      }
    }).sort((prev, post) => prev.id > post.id ? 1 : -1);
    new AngularCsv(ordered, `Lista Beneficiarios - ${new Date().toLocaleDateString()}`, options);
  }

  generatePDF() {
    const ordered = this.beneficiarios.map((elem) => {
      return {
        createdAt: new Date(elem.createdAt).toLocaleDateString(),
        identidad: elem.identidad,
        name: `${elem.name} ${elem.lastName}`,
        bornDate: new Date(elem.bornDate).toLocaleDateString(),
        municipality: `${elem.municipality}/${elem.village}`,
        monto: '',
        paymentDate: '',
        period: '',
        sign: ''
      }
    });

    const headers = [
      { text: 'Fecha De Ingreso Al Sistema', style: 'tableHeader', alignment: 'center' },
      { text: 'DNI', style: 'tableHeader', alignment: 'center' },
      { text: 'Nombre Completo', style: 'tableHeader', alignment: 'center' },
      { text: 'Fecha de Nacimiento', style: 'tableHeader', alignment: 'center' },
      { text: 'Municipio/Comunidad', style: 'tableHeader', alignment: 'center' },
      { text: 'Monto A Pagar', style: 'tableHeader', alignment: 'center' },
      { text: 'Fecha De Pago', style: 'tableHeader', alignment: 'center' },
      { text: 'Periodo', style: 'tableHeader', alignment: 'center' },
      { text: 'Firma y Huella', style: 'tableHeader', alignment: 'center' },
    ];

    const body = [headers];
    
    for (let element of ordered) {
      body.push(Object.keys(element).map((key) => element[key]));
    }

    const document = {
      pageOrientation: 'landscape',
      content: [
        {
          alignment: 'justify',
          columns: [
            {
              image: 'Honduras',
              width: 100
            },
            {
              stack: [
                'Secretaria de Desarrollo Social',
                { text: 'PRONASOL-H', style: 'subheader' },
                { text: 'BENEFICIARIOS TERCERA EDAD', style: 'subheader' },
              ],
              style: 'header',
              width: '*'

            },
            {
              image: 'Sedesol',
              width: 100
            },
          ]

        },
        {
          style: 'tableExample',
          table: {
            widths: [80, 'auto', 'auto', 80, 'auto', 70, 80, 70, 80],
            body,
          }
        },
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          alignment: 'center',
        },
        subheader: {
          fontSize: 14
        },
        superMargin: {
          margin: [20, 0, 40, 0],
          fontSize: 15
        },
        tableExample: {
          margin: [0, 20, 0, 20]
        },
        tableHeader: {
          bold: true,
          fontSize: 13,
          color: 'black'
        }
      },
      images: {
        Honduras: 'data:image/png;base64,',
        Sedesol: 'data:image/png;base64,'
      }
    }

    const fileName = `Planilla Beneficiarios - ${new Date().toLocaleDateString()}`;
    pdfmake.createPdf(document).download(fileName);
  }

  getBase64ImageFromURL(url) {
    return new Promise((resolve, reject) => {
      const img = new Image();
      // img.crossOrigin = "Anonymous";
      // img.src = url + "?not-from-cache-please";


      // var img = new Image();
      img.setAttribute('crossOrigin', 'anonymous');

      img.onload = () => {
        var canvas = document.createElement('canvas');
        canvas.width = img.width;
        canvas.height = img.height;

        var ctx = canvas.getContext('2d');
        ctx.drawImage(img, 0, 0);

        var dataURL = canvas.toDataURL('image/png');

        resolve(dataURL);
      };

      img.onerror = error => {
        reject(error);
      };

      img.src = url;
    });
  }
}